<img src='http://zsedebica.pl/wp-content/uploads/2019/03/26-marca.jpeg' alt='VI POWIATOWY TURNIEJ DEBAT OKSFORDZKICH' class='alignleft wp-post-image' width='200' height='140' />			</div>
<p>26 marca w Starostwie Powiatowym w Debicy odbyly sie eliminacje do VI Powiatowego Turnieju Debat Oksfordzkich. Patronat nad wydarzeniem objelo Krakowskie Stowarzyszenie Mowcow. W turnieju wzieli udzial uczniowie pieciu szkol ponadgimnazjalnych z powiatu debickiego. Wystartowaly druzyny: II Liceum Ogolnoksztalcacego im. ks. J. Twardowskiego, Zespolu Szkol Ekonomicznych im. J. Korczaka, Zespolu Szkol nr 2 im. E&#8230;. <a class="moretag" href="http://zsedebica.pl/?p=7605">Czytaj wiecej &raquo;</a></p>
</div><!-- .entry-summary -->

