title="Idz do: PILKARKI EKONOMIKA PONOWNIE MISTRZYNIAMI POWIATU DEBICKIEGO!" rel="bookmark">PILKARKI EKONOMIKA PONOWNIE MISTRZYNIAMI POWIATU DEBICKIEGO!				</a>
</h1>

</header><!-- .entry-header -->


<div class="entry-summary">
<!-- Forestly home page thumbnail with custom excerpt -->
<div class="excerpt-thumb">
<img src='http://zsedebica.pl/wp-content/uploads/2019/03/Zawody.png' alt='PILKARKI EKONOMIKA PONOWNIE MISTRZYNIAMI POWIATU DEBICKIEGO!' class='alignleft wp-post-image' width='200' height='140' />			</div>
<p>Zenska reprezentacja Zespolu Szkol Ekonomicznych w Debicy wywalczyla 1. miejsce w powiatowym turnieju piki noznej. Podopieczne trenera Wojciecha Szydlo okazaly sie bezkonkurencyjne dla rywalek i w swietnym stylu obronily tytul wywalczony rowniez przed rokiem. 19 marca hala I Liceum Ogolnoksztalcacego goscila najlepsze pilkarki z calego powiatu. Nasze zawodniczki wraz z gospodyniami turnieju zostaly rozstawione do&#8230; <a class="moretag" href="http://zsedebica.pl/?p=7595">Czytaj wiecej &raquo;</a></p>
</div><!-- .entry-summary -->

