<h1 class="entry-title">
<a href="http://zsedebica.pl/?p=7590"
title="Idz do: ,,Poznaj prawde, a prawda cie uwolni!"" rel="bookmark">,,Poznaj prawde, a prawda cie uwolni!"				</a>
</h1>

</header><!-- .entry-header -->


<div class="entry-summary">
<!-- Forestly home page thumbnail with custom excerpt -->
<div class="excerpt-thumb">
<img src='http://zsedebica.pl/wp-content/uploads/2019/03/IMG_20190311_102103.jpg' alt=',,Poznaj prawde, a prawda cie uwolni!"' class='alignleft wp-post-image' width='200' height='140' />			</div>
<p>11 marca odwiedzil nas Pan Marcin Tyburczy, ktory z ramienia Fundacji ,,Latarnia" poprowadzil autorskie spotkanie z mlodzieza pt.,,Poznaj prawde, a prawda cie uwolni". Tematyka spotkania dotyczyla prawdy o sobie i wolnosci, poznania siebie, zobaczenia swojej wartosci i niepowtarzalnosci oraz szacunku i budowania dobrych relacji z innymi. Wstrzasajace i prawdziwe historie opowiedziane w trakcie spotkania ukazaly&#8230; <a class="moretag" href="http://zsedebica.pl/?p=7590">Czytaj wiecej &raquo;</a></p>
</div><!-- .entry-summary -->

