<h1 class="entry-title">
<a href="http://zsedebica.pl/?p=7584"
title="Idz do: Pamietamy o zolnierzach niezlomnych" rel="bookmark">Pamietamy o zolnierzach niezlomnych				</a>
</h1>

</header><!-- .entry-header -->


<div class="entry-summary">
<!-- Forestly home page thumbnail with custom excerpt -->
<div class="excerpt-thumb">
<img src='http://zsedebica.pl/wp-content/uploads/2019/03/poczet-3.jpg' alt='Pamietamy o zolnierzach niezlomnych' class='alignleft wp-post-image' width='200' height='140' />			</div>
<p>W niedziele 10 marca 2019  r. od godziny 10:00 uczniowie naszej szkoly brali udzial w uroczystosciach patriotyczno-religijnych zwiazanych z obchodami Narodowego Dnia Zolnierzy Wykletych. W uroczystosciach, poza wlodarzami naszego miasta i powiatu, uczestniczyli zolnierze 33 Batalionu Lekkiej Piechoty 3 Podkarpackiej Brygady Obrony Terytorialnej im. Lukasza Cieplinskiego, poczty sztandarowe szkol i instytucji, czlonkowie Zwiazku Strzeleckiego, mieszkancy&#8230; <a class="moretag" href="http://zsedebica.pl/?p=7584">Czytaj wiecej &raquo;</a></p>
</div><!-- .entry-summary -->

